(127, 'Cac_diem_dich_chuyen', 'https://genshin.honeyhunterworld.com/img/i_3005.webp', 'Các điểm dịch chuyển', 'https://cdn.discordapp.com/attachments/1059757950949920799/1062333881824583741/Cac_Diem_Dich_Chuyen.rar|', '<p>Tổng hợp các điểm có thể dịch chuyển. File tele này chỉ dùng để đưa bạn tới vị trí đó chứ ko tự động mở điểm dịch chuyển, bạn tự mở bằng tay nhá.</p><p>*Tệp nén gồm:&nbsp;</p><p>Điểm dịch chuyển,Thất thiên thần tượng, Bí Cảnh: Mondstadt, Liyue, Sumeru,', 'aHYC-MuWc8I|', '10/01/2023');
